import React from "react";
import "../stylesheets/App.scss";
import ClubList from "./ClubList";
import clubs from "../data/clubs.json";

const App = () => {
  return (
    <>
      <h1> Mis clubes favoritos</h1>
      <div className="App">
        <ClubList clubsData={clubs} />
      </div>
    </>
  );
};

export default App;
